import React from "react";
import { Link } from "react-router-dom";
import AuthService from "../../services/auth.service";

const Navbar = () => {
  const [showAdminBoard, setShowAdminBoard] = useState(false);
  const [currentUser, setCurrentUser] = useState(undefined);

  useEffect(() => {
    const user = AuthService.getCurrentUser();

    if (user) {
      setCurrentUser(user);
      setShowModeratorBoard(user.roles.includes("ROLE_MODERATOR"));
      setShowAdminBoard(user.roles.includes("ROLE_ADMIN"));
    }
  }, []);

  const logOut = () => {
    AuthService.logout();
  };

    return(
      <>
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <Link to="/" className="navbar-brand">Misha Infotech</Link>
        <button
            className="navbar-toggler"
            type="button"
            data-toggle="collapse"
            data-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon" />
          </button>
      
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav mr-auto">
                <li className="nav-item">
                  <Link to="/register" className="nav-link">Sitter Registration</Link>
                </li>
                <li className="nav-item">
                  <Link to="/search" className="nav-link">Search</Link>
                </li>      
                <li className="nav-item">	      	               
                  <Link to="/admin/sitterlist" className="nav-link">Sitter Records</Link>	                       
                </li>	      
                <li className="nav-item">                
                  <Link to="/profile" className="nav-link">Profile</Link>                 
                </li>
                <li className="nav-item">
                  <Link to="/login" className="nav-link">Login</Link>
                </li>
          </ul>  	
                  {/* <a className="navbar-text nav-link" href="/profile">UserName </a>		 */}
                  <div className="navbar-nav ml-auto">
                      {/* <li className="nav-item">
                        <Link to={"/profile"} className="nav-link">
                          {currentUser.username}
                        </Link>
                      </li> */}
                      <li className="nav-item">
                        <a href="/login" className="nav-link" onClick={logOut}>
                          LogOut
                        </a>
                      </li>
                    </div>    
        </div>
      </nav>
      </>
    );
}

 export default Navbar;
